import React from "react";
import { Button } from ".";
import "../scss/components/createPost.scss";

function CreatePost() {
  return (
    <div className="create-post">
      <h2>create your post</h2>
      <form action="">
        <div className="title-block">
          <p className="header-for-post-form">title</p>
          <input type="text" className="input-for-title" />
        </div>

        <div className="post-block">
          <p className="header-for-post-form">post</p>
          <textarea
            type="text"
            className="input-for-post"
            rows="5"
            cols="40"
            rows="10"
          ></textarea>
        </div>

        <Button type="button" className="button-create">
          Create
        </Button>
      </form>
    </div>
  );
}

export default CreatePost;
